import React from 'react';

function About() {
  return (
    <div>
      <h1>신혜원</h1>
      <h2>Shin Hyewon</h2>
      <p>서울대학교 디자인과 시각디자인전공 & 연합전공 정보문화학
        <br></br>데이터를 활용한 디자인에 관심이 많습니다. 그리고 오타쿠입니다. 남성향 로맨스 애니 ㅈㄴ재밋습니다. 프로덕트 디자인을 중점적으로 공부하며 시각디자인의 여러 분야를 탐구하고 있습니다.
      </p>
    </div>
  );
}

export default About;
